import { BsCodeSlash } from "react-icons/bs";

function BoutonImage({ ImageComponent, onClick }) {
	return <ImageComponent className='bouton-image' onClick={onClick} width='40px' height='auto' />;
}

export default function RubriqueSelector({ selected, setSelected }) {
	return <BoutonImage onClick={() => setSelected(0)} ImageComponent={BsCodeSlash} />;
}
